import React from "react";
import { Button } from "@mantine/core";
import "./Lang.css";

const Lang = () => {
  return (
    <div className="lang">
      <div className="lang-background">
        <div className="btn">
          <div className="btn-back">
            <button></button>
          </div>
          <div className="btn-english">
            <Button
              variant="gradient"
              gradient={{ from: "indigo", to: "cyan" }}
            >
              Primary
            </Button>
          </div>
          <div className="btn-bengali">
            <Button
              variant="gradient"
              gradient={{ from: "indigo", to: "cyan" }}
              fullWidth="50px"
            >
              Secondary
            </Button>{" "}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Lang;
